package ru.ivanovaanastasiya.lesson_1.obstacles;import ru.ivanovaanastasiya.lesson_1.participants.Participant;public class Wall extends  Obstacle {    private int height;    public Wall(int height) {        this.height = height;    }    @Override    public int getValue() {        return height;    }    @Override    public void doIt(Participant p) {        p.jump(height);    }}